import './App.css';
import Navbar from './components/nav-bar.jsx';
import Footer from './components/footer.jsx';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import MenuItem from '@material-ui/core/MenuItem';
import {DropzoneDialog, DropzoneArea} from 'material-ui-dropzone';
import ModalTest from './components/modal.jsx';
import Button from '@material-ui/core/Button';
import {
    BrowserRouter as Router,
    Switch,
    Route, 
    Link
  } from "react-router-dom";




  /* FOR PARTNERSHIP QUESTIONS */

  const booleans = [
      { 
          value: 'Yes',
          label: 'Yes',
      },
      {
          value: 'No',
          label: 'No',
      }
  ]


  const automation = [ 
      { 
          value: 'AI', 
          label: 'AI Automation',
      }, 
      {
          value: 'Manual',
          label: 'Manually Input',
      }
  ]

  const companies = [
    {
      value: 'Corporation',
      label: 'Corporation',
    },
    {
      value: 'LLC',
      label: 'LLC',
    },
    {
      value: 'Parternship',
      label: 'Partnership',
    },
  ];


  const useStyles = makeStyles((theme) => ({
    root: {
      '& .MuiTextField-root': {
        margin: theme.spacing(1),
        width: '25ch',
      },
    },
  }));

  const newMember = () => {
      return (
        <div class="new-member">
        <div class="name-input-llc" style={{textAlign: "center"}}>
            <TextField id="outlined-basic" label="Name" variant="outlined" style={{width: "500px"}} /> 
        </div> 
        <br></br>
        <div class="email-input-llc" style={{textAlign: "center"}}>
            <TextField id="outlined-basic" label="Email" variant="outlined" style={{width: "500px"}} /> 
        </div> 
        <br></br>
        <div class="percent-ownership" style={{textAlign: "center"}}>
           <TextField
               id="outlined-number"
               label="Percentage of ownership"
               type="number"
               InputLabelProps={{
                   shrink: true,
               }}
               variant="outlined"
               style={{width: "500px"}}
           />
       </div>
       <br></br>
       <div class="percent-profits-received" style={{textAlign: "center"}}>
           <TextField
               id="outlined-number"
               label="Percent of profits received"
               type="number"
               InputLabelProps={{
                   shrink: true,
               }}
               variant="outlined"
               style={{width: "500px"}}
           />
       </div>
       </div>
      );
  }



export default function AutomateGov() { 
    const classes = useStyles();
    const [company, setCompany] = React.useState();
    const [USstate, setState] = React.useState();
    const [boolean, setBoolean] = React.useState();
    const [membersList, setMembersList] = React.useState([{name: "", email: "", percentShares: "", percentProfit: ""}]);
    const [automate, setAutomation] = React.useState();
    const [open, setOpen] = React.useState(false); 
    const [files, setFiles] = React.useState([]); 



    const handleClose = (event) => {
        setOpen(false);

    }

    function handleChange(files) {
        setFiles(files); 
    }

    const handleOpen = (event) => { 
        setOpen(true);
    }

  /*  const [members, setMembers] = React.useState(0);

  {/*  const handleChangeMembers = (event) => {
        setMembers(members => [...members, <newMember />])
    }

    {/*

    const addMember = (event) => {
        this.setState({
            members: [...this.state.members, <newMember /> ]
        })
    }

*/

    const handleChangeAutomation = (event) => { 
        setAutomation(event.target.value);
    }

    const handleChangeBoolean = (event) => {
            setBoolean(event.target.value);
    }

    const handleChangeCompany = (event) => {
            setCompany(event.target.value);
          };

    const handleChangeState = (event) => {
            setState(event.target.value);
          };

    const  handleMembersChange = (e) => {
            let membersList = [...membersList]
            membersList[e.target.dataset.id][e.target.className] = e.target.value
            setMembersList({ membersList }, () => console.log(membersList))
          }

    const  addMembers = (e) => {
            e.preventDefault();
            setMembersList((prevState) => ({
              membersList: [...prevState.membersList, { name: "", email: "", percentShares: "", percentProfit: "" }],
            }));
          }



        return (
            <div class="full-page">
            <div class="company-id-page">
                <Navbar />

                <br></br>
                <br></br>
                <br></br>
                <br></br>
                <br></br>
                <h1 style={{color: "#245CA6"}}> Automate Governance </h1>
              <br></br>
            <div style={{textAlign:"center"}}>
                <svg height={50} width={500}>
                    <line class="svg-line-1" x1={1} x2={500} y1={1} y2={1}/>
                </svg>
                </div>
            <p style={{textAlign: "center"}}> Welcome! </p>
            <br></br>
            <form className={classes.root} noValidate autoComplete="off">
            <div class="login-form" style={{textAlign: "center"}}>
             <div class="partnership-questions">



             <div class="automate-choice">
                        <TextField
                            id="outlined-select-consent"
                            select label="How would you like to Automate your Governance?"
                            value={automate}
                            onChange={handleChangeAutomation}
                            variant="outlined"
                            style={{width: "500px"}}
                         >
                        {automation.map((option) => (
                        <MenuItem key={option.value} value={option.value}>
                            {option.label}
                        </MenuItem>
                            ))}
                        </TextField>
                        < br/>
                </div>



            { automate === 'AI' && ( 
                    <form> 
            <br />
            <div class="upload-formation">
            <p style={{textAlign: "center"}}> Please upload formation documents </p>

             <DropzoneArea
                    onChange={handleChange.bind(this)}
                    filesLimit={10}
                    />

                    </div> 

                    <br />
                    <br />

            <div class="upload-governance">
            <p style={{textAlign: "center"}}> Please upload governance documents </p>

             <DropzoneArea
                    onChange={handleChange.bind(this)}
                    filesLimit={10}
                    />

                    </div> 
                    <br />
                    <br />


            <div class="upload-company-minutes">
            <p style={{textAlign: "center"}}> Please upload company's form of resolutions and meeting minutes </p>

             <DropzoneArea
                    onChange={handleChange.bind(this)}
                    filesLimit={10}
                    />

                    </div> 

             <br />
             < br/>
             <center>
                  <div class="gov-button-1" >
                       <p style={{textAlign: "center"}}> Finish Intializing Your Company </p>
                   </div>
            </center>


                    </form>


            )}





            <br />
            <br />

            </div>


            { automate === 'Manual' && (

                <form>

<div class="upload-formation">
            <p style={{textAlign: "center"}}> Please upload formation documents </p>

             <DropzoneArea
                    onChange={handleChange.bind(this)}
                    filesLimit={10}
                    />

                    </div> 

                    <br />
                    <br />

            <div class="upload-governance">
            <p style={{textAlign: "center"}}> Please upload governance documents </p>

             <DropzoneArea
                    onChange={handleChange.bind(this)}
                    filesLimit={10}
                    />

                    </div> 
                    <br />
                    <br />


            <div class="upload-company-minutes">
            <p style={{textAlign: "center"}}> Please upload company's form of resolutions and meeting minutes </p>

             <DropzoneArea
                    onChange={handleChange.bind(this)}
                    filesLimit={10}
                    />

                    </div> 


                    <br />
                    < br/> 
             <div class="unanimous-choice">
                        <TextField
                            id="outlined-select-consent"
                            select label="Does your partnership require unanimous consent?"
                            value={boolean}
                            onChange={handleChangeBoolean}
                            variant="outlined"
                            style={{width: "500px"}}
                         >
                        {booleans.map((option) => (
                        <MenuItem key={option.value} value={option.value}>
                            {option.label}
                        </MenuItem>
                            ))}
                        </TextField>
                </div>



              { boolean === 'No' && ( 

                    <form>
                        <br />
                        <div class="vote-action">
                        <TextField
                            id="outlined-number"
                            label="What is a sufficient vote to take partnership action?"
                            type="number"
                            InputLabelProps={{
                                shrink: true,
                            }}
                            variant="outlined"
                            style={{width: "500px"}}
                        />

                        </div>
                    </form> 

              )}


                    <br></br>
                    <div class="num-partners" style={{textAlign: "center"}}>
                        <TextField
                            id="outlined-number"
                            label="How many partners does your business have?"
                            type="number"
                            InputLabelProps={{
                                shrink: true,
                            }}
                            variant="outlined"
                            style={{width: "500px"}}
                        />
                    </div>
                    <br></br>

                    <p style={{textAlign: "center"}}> Please enter the following information for all Members or Managers </p>

                    <div class="new-member">
                     <div class="name-input" style={{textAlign: "center"}}>
              <TextField id="outlined-basic" label="Name" variant="outlined" style={{width: "500px"}} /> 
                </div> 
                <br></br>
                <div class="email-input" style={{textAlign: "center"}}>
              <TextField id="outlined-basic" label="Email" variant="outlined" style={{width: "500px"}} /> 
                </div> 
                <br></br>
                <div class="percent-ownership" style={{textAlign: "center"}}>
                        <TextField
                            id="outlined-number"
                            label="Percentage of ownership"
                            type="number"
                            InputLabelProps={{
                                shrink: true,
                            }}
                            variant="outlined"
                            style={{width: "500px"}}
                        />
                    </div>
                    <br></br>
                    <div class="percent-profits-received" style={{textAlign: "center"}}>
                        <TextField
                            id="outlined-number"
                            label="Percent of profits received"
                            type="number"
                            InputLabelProps={{
                                shrink: true,
                            }}
                            variant="outlined"
                            style={{width: "500px"}}
                        />
                    </div>
                    <br /> 
                    <div class="percent-losses-received" style={{textAlign: "center"}}>
                        <TextField
                            id="outlined-number"
                            label="Percent of losses received"
                            type="number"
                            InputLabelProps={{
                                shrink: true,
                            }}
                            variant="outlined"
                            style={{width: "500px"}}
                        />
                    </div>
                    </div>




             <br></br>


             {/*}

             <p style={{textAlign: "center"}}> Please upload formation documents </p>

             <TextField
             name="upload-file"
             type="file"
             variant="outlined"
             helperText="upload"
              />
              <br />
              <br />

            <p style={{textAlign: "center"}}> Please upload governance documents </p>

            <TextField
            name="upload-file"
            type="file"
            variant="outlined"
            helperText="upload"
             />

            < br/> 
            < br/> 

            <p style={{textAlign: "center"}}> Please upload company's form of resolution and meeting minutes </p>

            <TextField
            name="upload-file"
            type="file"
            variant="outlined"
            helperText="upload"
             />

            {/*   <div class="upload">
                    <Button onClick={handleOpen}>
                  Add Image
                </Button>
                <DropzoneDialog
                    open={open}
              /*      onSave={handleSave(this)} 
                    acceptedFiles={['image/jpeg', 'image/png', 'image/bmp']}
                    showPreviews={true}
                    maxFileSize={5000000}
                    onClose={handleClose}
                />
                </div>
                        */}




             <br />
             <br />
             <br />
             <center>
                  <div class="gov-button-1" >
                       <p style={{textAlign: "center"}}> Finish Intializing Your Company </p>
                   </div>
            </center>

                </form>  

          )}


                <br></br>
                <br></br>
                <br></br>

                </div>
            </form> 
            </div> 

                <Footer />


            </div>
        );
}
